import React, { Component } from 'react';
import logo from './logo.svg';
import Footer from './components/footer'

import Home from './components/home'

class App extends Component {






  render() {



    return (
      <div className="App">

        <div>

           <Home />
       </div>

       <Footer />



      </div>
    );
  }
}

export default App;
